-- First, get or create San Joaquin County agency
INSERT IGNORE INTO counties (name, state, usesStateProtocols, protocolVersion, createdAt)
VALUES ('San Joaquin County EMS Agency', 'California', 0, '1.9.1', NOW());

-- Get the county ID
SELECT id, name FROM counties WHERE name LIKE '%San Joaquin%' AND state = 'California' LIMIT 1;

